import Hero from "./Components/Hero";
import Navbar from "./Components/Navbar";
import CardBox from "./Components/CardBox"
import Footer from "./Components/Footer";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>

 <div className="App">
      <Navbar />
      <Hero />
     <CardBox/>
     <Footer/>

    </div>
    </Routes>

  );
}

export default App;
